var keepFaviconInterval = null;

var currentUrl = null;

var hadNotification = false;

var defaultNotificationRegex = /^([*!]|\(\d+\))/g;


///
/// Add a notification indicator to a favicon.
///
function AddNotificationIndicator(favicon, notificationColor) {
    var faviconSize = 32;
    
    var canvas = document.createElement("canvas");
    canvas.width = faviconSize;
    canvas.height = faviconSize;
    
    var context = canvas.getContext("2d");
    var img = document.createElement("img");
    img.crossOrigin = "Anonymous";
    img.src = favicon.href;
    
    img.onload = () => {
        // Draw original favicon as background
        context.drawImage(img, 0, 0, faviconSize, faviconSize);
        
        // Draw notification circle
        context.beginPath();
        var circleRadius = faviconSize / 5;
        context.arc(
            canvas.width - circleRadius,
            canvas.height - circleRadius,
            circleRadius,
            0,
            2 * Math.PI
        );
        context.fillStyle = notificationColor;
        context.fill();
        
        // Draw notification number
        /*/
        context.font = '10px "Helvetica", sans-serif';
        context.textAlign = "center";
        context.textBaseline = "middle";
        context.fillStyle = "#ffffff";
        context.fillText(3, canvas.width - faviconSize / 3, faviconSize / 3);
        //*/
        
        // Replace favicon
        favicon.href = canvas.toDataURL("image/png");
    };
}


///
/// Set a custom favicon.
///
function SetFavicon(faviconUrl, notificationColor, notificationRegex) {
    //Util.Log(`SetFavicon(${faviconUrl})`);
    
    if (currentUrl != window.location.href) {
        // The URL has changed, run Init() again
        Init();
        
        return;
    }
    
    var icons = document.querySelectorAll("link[rel*='icon']");
    
    var favicon = null;
    var hasNotification = (document.title.match(notificationRegex) != null);
    
    Util.Log("DEBUG", "title: " + document.title)
    Util.Log("DEBUG", "has: " + hasNotification)
    Util.Log("DEBUG", "had: " + hadNotification)
    
    for (var i = 0; i < icons.length; ++i) {
        var icon = icons[i];
        
        Util.Log("DEBUG", "is custom:                 " + icon.classList.contains("custom-favicon"));
        Util.Log("DEBUG", "notification states match: " + (hadNotification == hasNotification));
        
        if ((icon.href == faviconUrl) && (hadNotification == hasNotification)) {
            // Already set
            favicon = icon;
        }
        else {
            // Remove old icon
            Util.Log("INFO", "Removing favicon: " + icon.href);
            icon.parentNode.removeChild(icon);
            favicon = null;
        }
    }
    
    hadNotification = hasNotification;
    
    if (favicon == null) {
        Util.Log("INFO", "Creating custom favicon: " + faviconUrl);
        favicon = document.createElement("link");
        favicon.rel = "icon";
        favicon.href = faviconUrl;
        favicon.classList.add("custom-favicon");
        favicon.type = "image/png";
        
        if (hasNotification) {
            AddNotificationIndicator(favicon, notificationColor);
        }
        
        document.getElementsByTagName("head")[0].append(favicon);
    }
}


///
/// "Keep" a custom favicon (in case the site resets the favicon).
///
function KeepFavicon(faviconUrl,
                     notificationColor = "#ff0000",
                     notificationRegex = defaultNotificationRegex) {
    Util.Log(`KeepFavicon(${faviconUrl})`);
    
    if (keepFaviconInterval != null) {
        Util.Log("Clear old interval");
        clearInterval(keepFaviconInterval);
        keepFaviconInterval = null;
    }
    
    keepFaviconInterval = setInterval(
        function () {
            SetFavicon(faviconUrl, notificationColor, notificationRegex);
        },
        1000
    );
}


///
/// Initialize.
///
function Init() {
    Util.Log("Init()");
    
    currentUrl = window.location.href;
    
    for (var i = 0; i < favicons.length; ++i) {
        var favicon = favicons[i];
        
        if (favicon.regex.test(currentUrl)) {
            Util.Log("Set custom favicon for URL: " + currentUrl);
            Util.Log("Matching regex: " + favicon.regex);
            
            KeepFavicon(
                favicon.favicon,
                favicon.notificationColor,
                favicon.notificationRegex
            );
            
            // Can only set one custom favicon
            break;
        }
    }
}


(
    function () {
        "use strict";
        
        if (Util.InIframe()) {
            return;
        }
        
        setTimeout(Init, 500);
    }
)();
